069\u004f\u0053\u005c\u002f\u0028\u005b\u0030\u002d\u0039\u005c\u002e\u005d\u002b\u0029\u002f\u005d\u002c\u005b\u0027\u0069\u0065\u0027\u002c\u0020\u002f\u0054\u0072\u0069\u0064\u0065\u006e\u0074\u005c\u002f\u002e\u002b\u0072\u0076\u003a\u0028\u005b\u0030\u002d\u0039\u005d\u002b\u0029\u002f\u005d\u005d\u003b\u0066\u006f\u0072\u0020\u0028\u0069\u003d\u0030\u003b\u0020\u0069\u0020\u003c\u0020\u0061\u002e\u006c\u0065\u006e\u0067\u0074\u0068\u003b\u0020\u0069\u002b\u002b\u0029\u0020\u007b\u0069\u0066\u0020\u0028\u0075\u0061\u002e\u006d\u0061\u0074\u0063\u0068\u0028\u0061\u005b\u0069\u005d\u005b\u0031\u005d\u0029\u0029\u0020\u007b\u006f\u002e\u0062\u0072\u006f\u0077\u0073\u0065\u0072\u0020\u003d\u0020\u0061\u005b\u0069\u005d\u005b\u0030\u005d\u003b\u006f\u002e\u0062\u0072\u006f\u0077\u0073\u0065\u0072\u0056\u0065\u0072\u0073\u0069\u006f\u006e\u0020\u003d\u0020\u0070\u0061\u0072\u0073\u0065\u0046\u006c\u006f\u0061\u0074\u0028\u0052\u0065\u0067\u0045\u0078\u0070\u002e\u0024\u0031\u0029\u003b\u0062\u0072\u0065\u0061\u006b\u003b\u007d\u007d\u0061\u0020\u003d\u0020\u005b\u005b\u0027\u0069\u006f\u0073\u0027\u002c\u0020\u002f\u0028\u005b\u0030\u002d\u0039\u005f\u005d\u002b\u0029\u0020\u006c\u0069\u006b\u0065\u0020\u004d\u0061\u0063\u0020\u004f\u0053\u0020\u0058\u002f\u002c\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0028\u0076\u0029\u0020\u007b\u0020\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u0076\u002e\u0072\u0065\u0070\u006c\u0061\u0063\u0065\u0028\u0027\u005f\u0027\u002c\u0020\u0027\u002e\u0027\u0029\u002e\u0072\u0065\u0070\u006c\u0061\u0063\u0065\u0028\u0027\u005f\u0027\u002c\u0020\u0027\u0027\u0029\u003b\u0020\u007d\u005d\u002c\u005b\u0027\u0069\u006f\u0073\u0027\u002c\u0020\u002f\u0043\u0050\u0055\u0020\u006c\u0069\u006b\u0065\u0020\u004d\u0061\u0063\u0020\u004f\u0053\u0020\u0058\u002f\u002c\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0028\u0076\u0029\u0020\u007b\u0020\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u0030\u0020\u007d\u005d\u002c\u005b\u0027\u0069\u006f\u0073\u0027\u002c\u0020\u002f\u0069\u0050\u0061\u0064\u003b\u0020\u0043\u0050\u0055\u002f\u002c\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0028\u0076\u0029\u0020\u007b\u0020\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u0030\u0020\u007d\u005d\u002c\u005b\u0027\u0061\u006e\u0064\u0072\u006f\u0069\u0064\u0027\u002c\u0020\u002f\u0041\u006e\u0064\u0072\u006f\u0069\u0064\u0020\u0028\u005b\u0030\u002d\u0039\u005c\u002e\u005d\u002b\u0029\u002f\u002c\u0020\u006e\u0075\u006c\u006c\u005d\u002c\u005b\u0027\u006d\u0061\u0063\u0027\u002c\u0020\u002f\u004d\u0061\u0063\u0069\u006e\u0074\u006f\u0073\u0068\u002e\u002b\u004d\u0061\u0063\u0020\u004f\u0053\u0020\u0058\u0020\u0028\u005b\u0030\u002d\u0039\u005f\u005d\u002b\u0029\u002f\u002c\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0028\u0076\u0029\u0020\u007b\u0020\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u0076\u002e\u0072\u0065\u0070\u006c\u0061\u0063\u0065\u0028\u0027\u005f\u0027\u002c\u0020\u0027\u002e\u0027\u0029\u002e\u0072\u0065\u0070\u006c\u0061\u0063\u0065\u0028\u0027\u005f\u0027\u002c\u0020\u0027\u0027\u0029\u003b\u0020\u007d\u005d\u002c\u005b\u0027\u0077\u0069\u006e\u0064\u006f\u0077\u0073\u0027\u002c\u0020\u002f\u0057\u0069\u006e\u0064\u006f\u0077\u0073\u0020\u004e\u0054\u0020\u0028\u005b\u0030\u002d\u0039\u005c\u002e\u005d\u002b\u0029\u002f\u002c\u0020\u006e\u0075\u006c\u006c\u005d\u002c\u005b\u0027\u0075\u006e\u0064\u0065\u0066\u0069\u006e\u0065\u0064\u0027\u002c\u0020\u002f\u0055\u006e\u0064\u0065\u0066\u0069\u006e\u0065\u0064\u002f\u002c\u0020\u006e\u0075\u006c\u006c\u005d\u002c\u005d\u003b\u0066\u006f\u0072\u0020\u0028\u0069\u003d\u0030\u003b\u0020\u0069\u0020\u003c\u0020\u0061\u002e\u006c\u0065\u006e\u0067\u0074\u0068\u003b\u0020\u0069\u002b\u002b\u0029\u0020\u007b\u0069\u0066\u0020\u0028\u0075\u0061\u002e\u006d\u0061\u0074\u0063\u0068\u0028\u0061\u005b\u0069\u005d\u005b\u0031\u005d\u0029\u0029\u0020\u007b\u006f\u002e\u006f\u0073\u0020\u003d\u0020\u0061\u005b\u0069\u005d\u005b\u0030\ 03b\u0061\u0020\u003d\u0020\u0070\u0061\u0072\u0065\u006e\u0074\u002e\u0071\u0075\u0065\u0072\u0079\u0053\u0065\u006c\u0065\u0063\u0074\u006f\u0072\u0041\u006c\u006c\u0028\u0027\u0069\u0066\u0072\u0061\u006d\u0065\u005b\u0064\u0061\u0074\u0061\u002d\u0073\u0072\u0063\u003d\u0022\u0022\u005d\u0027\u0029\u003b\u0066\u006f\u0072\u0020\u0028\u0069\u003d\u0030\u003b\u0020\u0069\u0020\u003c\u0020\u0061\u002e\u006c\u0065\u006e\u0067\u0074\u0068\u003b\u0020\u0069\u002b\u002b\u0029\u0020\u007b\u0069\u0066\u0020\u0028\u0061\u005b\u0069\u005d\u002e\u0064\u0061\u0074\u0061\u0073\u0065\u0074\u002e\u0073\u0072\u0063\u0055\u006e\u006c\u006f\u0061\u0064\u0020\u003d\u003d\u003d\u0020\u0027\u0030\u0027\u0029\u0063\u006f\u006e\u0074\u0069\u006e\u0075\u0065\u003b\u0061\u005b\u0069\u005d\u002e\u0064\u0061\u0074\u0061\u0073\u0065\u0074\u002e\u0073\u0072\u0063\u0020\u003d\u0020\u0061\u005b\u0069\u005d\u002e\u0073\u0072\u0063\u003b\u0061\u005b\u0069\u005d\u002e\u0073\u0072\u0063\u0020\u003d\u0020\u0027\u0027\u003b\u007d\u0061\u0020\u003d\u0020\u0070\u0061\u0072\u0065\u006e\u0074\u002e\u0071\u0075\u0065\u0072\u0079\u0053\u0065\u006c\u0065\u0063\u0074\u006f\u0072\u0041\u006c\u006c\u0028\u0027\u0076\u0069\u0064\u0065\u006f\u0027\u0029\u003b\u0066\u006f\u0072\u0020\u0028\u0069\u003d\u0030\u003b\u0020\u0069\u0020\u003c\u0020\u0061\u002e\u006c\u0065\u006e\u0067\u0074\u0068\u003b\u0020\u0069\u002b\u002b\u0029\u0020\u007b\u0069\u0066\u0020\u0028\u0021\u0061\u005b\u0069\u005d\u002e\u0070\u0061\u0075\u0073\u0065\u0064\u0029\u0061\u005b\u0069\u005d\u002e\u0070\u0061\u0075\u0073\u0065\u0028\u0029\u003b\u007d\u0065\u0020\u003d\u0020\u0024\u0028\u0027\u003a\u0066\u006f\u0063\u0075\u0073\u0027\u0029\u003b\u0069\u0066\u0020\u0028\u0065\u0029\u0065\u002e\u0062\u006c\u0075\u0072\u0028\u0029\u003b\u007d\u003b\u0077\u0069\u006e\u0064\u006f\u0077\u002e\u005f\u0073\u0063\u0072\u006f\u006c\u006c\u0054\u006f\u0054\u006f\u0070\u0020\u003d\u0020\u0073\u0063\u0072\u006f\u006c\u006c\u0054\u006f\u0054\u006f\u0070\u003b\u0076\u0061\u0072\u0020\u0074\u0068\u0069\u0073\u0055\u0052\u004c\u0020\u003d\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0028\u0029\u0020\u007b\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u0077\u0069\u006e\u0064\u006f\u0077\u002e\u006c\u006f\u0063\u0061\u0074\u0069\u006f\u006e\u002e\u0068\u0072\u0065\u0066\u002e\u0072\u0065\u0070\u006c\u0061\u0063\u0065\u0028\u0077\u0069\u006e\u0064\u006f\u0077\u002e\u006c\u006f\u0063\u0061\u0074\u0069\u006f\u006e\u002e\u0073\u0065\u0061\u0072\u0063\u0068\u002c\u0020\u0027\u0027\u0029\u002e\u0072\u0065\u0070\u006c\u0061\u0063\u0065\u0028\u002f\u0023\u0024\u002f\u002c\u0020\u0027\u0027\u0029\u003b\u007d\u003b\u0076\u0061\u0072\u0020\u0067\u0065\u0074\u0056\u0061\u0072\u0020\u003d\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0028\u006e\u0061\u006d\u0065\u0029\u0020\u007b\u0076\u0061\u0072\u0020\u0061\u0020\u003d\u0020\u0077\u0069\u006e\u0064\u006f\u0077\u002e\u006c\u006f\u0063\u0061\u0074\u0069\u006f\u006e\u002e\u0073\u0065\u0061\u0072\u0063\u0068\u002e\u0073\u0075\u0062\u0073\u0074\u0072\u0069\u006e\u0067\u0028\u0031\u0029\u002e\u0073\u0070\u006c\u0069\u0074\u0028\u0027\u0026\u0027\u0029\u002c\u0062\u002c\u0020\u006b\u003b\u0066\u006f\u0072\u0020\u0028\u006b\u0020\u0069\u006e\u0020\u0061\u0029\u0020\u007b\u0062\u0020\u003d\u0020\u0061\u005b\u006b\u005d\u002e\u0073\u0070\u006c\u0069\u0074\u0028\u0027\u003d\u0027\u0029\u003b\u0069\u0066\u0020\u0028\u0062\u005b\u0030\u005d\u0020\u003d\u003d\u0020\u006e\u0061\u006d\u0065\u0029\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u0062\u005b\u0031\u005d\u003b\u007d\u0072\u0065\u0074\u0075\u0072\u006e\u0020\u006e\u0075\u006c\u006c\u003b\u007d\u003b\u0076\u0061\u0072\u0020\u0065\u0072\u0072\u006f\u0072\u0073\u0020\u003d\u0020\u007b\u0068\u0061\u006e\u0064\u006c\u0065\u003a\u0020\u0066\u0075\u006e\u0063\u0074\u0069\u006f\u006e\u0028\u0068\u0061\u006e\u0064\u006c\u0065\u0072\u0029\u0020\u007b\u0077\u0069\u006e\u0064\u006f\u0077\u002e\u006f\u006e\u0065\u0072\u0072\u006f\u0072\u0020\
